/** 
 * Returns the index of the DataSet that contains the closest value on the y-axis. This is needed for highlighting.
 * @param valsAtIndex all the values at a specific index
 * @return
 */
public static int getClosestDataSetIndex(ArrayList<SelInfo> valsAtIndex,float val,AxisDependency axis){
  int index=-1;
  float distance=Float.MAX_VALUE;
